import React from 'react';
import './App.css';

function App() {
  return (
    <div className="container">
      {/* Text Overlay */}
      <div className="overlay">
        <h1 className="inspire-text">BE INSPIRED</h1>
        <h2 className="explore-text">EXPLORE LIFE GYM</h2>
      </div>
    </div>
  );
}

export default App;
